    //     </div>
    //   </div>
    //   <a href="/Model">Model</a>

    // </div>
    <nav className="nav" id='navBar'>
      <img src={logo} className="logo" alt="logo" />
      <ul>
        <li><a href="/Model">Model</a></li>
        <li><a href='/Account'>Account</a></li>
        <li><a href='/SignIn' onClick={ClearCookies}>Sign Out</a></li>
      </ul>
    </nav>

  );
};
